function Select() {
    return (
        <>
            <select value={select} onChange={(e) => setSel(e.target.value)}>
                <option>USD</option>
                <option>EUR</option>
                <option>AUD</option>
                <option>CAD</option>
                <option>CNY</option>
            </select>
        </>
    )
}
